import styled from "styled-components";

const DivError = styled.div`
  background-color: #121214;
  height: 100vh;
  width: 100vw;
  display: flex;
  align-items: center;
  justify-content: center;
  img {
    width: 50vw;
    margin-bottom: 5rem;
  }
`;
export default DivError;
